// eventOwnerSelectors.js

export const selectBookings = (state) => state.eventOwner.bookings;
export const selectFeedbacks = (state) => state.eventOwner.feedbacks;
export const selectEvents = (state) => state.eventOwner.events;
export const selectUserProfile = (state) => state.eventOwner.userProfile;
export const selectLoading = (state) => state.eventOwner.loading;
export const selectError = (state) => state.eventOwner.error;
